import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { state: 'visible' });

    // Type 'iPhone' into the search input
    await page.fill('#searchInput', 'iPhone');

    // Wait for the search button (use first visible .search-btn)
    const searchBtn = await page.$('.search-btn');
    await searchBtn.waitForElementState('visible');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_search.png'));

    // Click the search button
    await searchBtn.click();

    // Wait for the search results to appear (wait for heading or results count)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Wait for at least one product card to appear
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Take screenshot of the search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles from the results
    const productTitles = await page.$$eval('.product-card .product-title', els =>
      els.map(e => e.textContent.trim())
    );

    // Filter for products containing 'iPhone' (case-insensitive)
    const iphoneProducts = productTitles.filter(title => /iphone/i.test(title));

    // Extract the number of results shown in the results count
    let resultsCountText = '';
    try {
      resultsCountText = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      // fallback if not found
      resultsCountText = '';
    }

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted matching product titles from the results.",
      extractedData: {
        resultsCountText,
        iphoneProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
